import React from 'react'

export default function TextSearchScreen({ navigation }) {
    return (
        <div>
            <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
                <Text>Home feffefefef</Text>
                <Button
                    title="Go to Details"
                    onPress={() => navigation.goBack()}
                />
            </View>
        </div>
    )
}
